  methods: {
    initilaize() {
      console.log("initilaize");
    },
    splitImage(targetImageDom, targetWidth, targetHeight) {
      // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/drawImage
      let targetDom = document.createElement("canvas");
      targetDom.setAttribute("width", targetWidth + "px");
      targetDom.setAttribute("height", targetHeight + "px");
      let context = targetDom.getContext("2d");
      let colListCnt = targetImageDom.width / targetWidth;
      let rowListCnt = targetImageDom.height / targetHeight;
      let preRowNumber = -1;
      // console.log(colListCnt, rowListCnt)
      let rowItemList;
      for (let index = 0; index < rowListCnt * colListCnt; index++) {
        context.clearRect(0, 0, targetWidth, targetHeight);
        const rowNumber = Math.floor(index / colListCnt);
        const colNumber = index % colListCnt;
        context.drawImage(
          targetImageDom,
          targetWidth * colNumber,
          targetHeight * rowNumber,
          targetWidth,
          targetHeight,
          0,
          0,
          targetWidth,
          targetHeight
        );

        if (rowNumber === preRowNumber) {
          rowItemList.push({
            rowId: rowNumber,
            colId: colNumber,
            dataSourceUrl: targetDom.toDataURL()
          });
        } else {
          if (index !== 0) {
            this.imageSrcSplitList.push(rowItemList);
          }
          rowItemList = [];
          rowItemList.push({
            rowId: rowNumber,
            colId: colNumber,
            dataSourceUrl: targetDom.toDataURL()
          });
        }

        // // console.log(rowNumber, colNumber);
        preRowNumber = rowNumber;
        if (rowNumber === 1 || rowNumber === 2) {
          console.log(JSON.stringify(this.imageSrcSplitList));
        }
      }
